import React from 'react';
import { Box, Typography, Button } from '@mui/material';
import { styled } from '@mui/material/styles';

const HeroSection = styled(Box)(({ theme }) => ({
  backgroundColor: '#566542',
  padding: theme.spacing(10, 2),
  color: '#fff',
  [theme.breakpoints.down('md')]: {
    textAlign: 'center',
    padding: theme.spacing(6, 2),
  },
}));

const Hero: React.FC = () => {
  return (
    <HeroSection>
      <Box
        sx={{
          display: 'flex',
          flexWrap: 'wrap',
          gap: 4,
          justifyContent: 'center',
          alignItems: 'center',
        }}
      >
        <Box sx={{ flex: { xs: '1 1 100%', md: '1 1 50%' }, maxWidth: { md: '50%' } }}>
          <Typography variant="h4" component="h1" fontWeight={600} gutterBottom>
            Psicólogo Clínico | CRP 07/42111
          </Typography>
          <Typography variant="h6" gutterBottom>
            Meu propósito é <strong>ajudar você</strong> a ter mais qualidade de vida com saúde mental e emocional.
          </Typography>
          <Button
            variant="contained"
            size="large"
            sx={{
              mt: 3,
              backgroundColor: '#c6a393',
              color: '#fff',
              fontWeight: 700,
              '&:hover': { backgroundColor: '#b78f7d' },
            }}
            href="#contact"
          >
            Agende sua consulta
          </Button>
        </Box>
      </Box>
    </HeroSection>
  );
};

export default Hero;
